                 <p className="content-justify p-1">Advertising is a marketing communication that employs an openly sponsored, non-personal message to promote or sell a product, service or idea. Sponsors of advertising are typically businesses wishing to promote their products or services.
                       <img src="https://bit.ly/3ux0hgk" style={{width:'70%' , height:'300px', padding:'5px'}}/>
                 </p>
         </div>
    </>)
}

